    const [notes, setNotes] = useState([
        // {id:1, content:'boba'},
        // {id:2, content:'aboba'},
        // {id:3, content:'agfsoba'},
    ]);

    const createNote = (newNote) => {
        setNotes([...notes, newNote]);
    };

    return (
        <div className="App">
            <Header/>
            <Todos notes={notes} create={createNote}/>
        </div>
    );
}

export default App;
